import React, { Component } from "react";
import headerMarket from './headerMarket';
import "./background.css";
import {Tab, Tabs, Row} from 'react-bootstrap';
export default class Dashboard extends Component{
    render(){
        return(
            <>
                <div>
                    {<headerMarket/>}
                </div>
            </>
        )
    }
}
